import Input from '../forms/Input'
import Select from '../forms/Select'
import {useEffect, useState} from 'react'

function ContaForms(){
    const [tiposContas,setTiposContas]=useState()

    useEffect(()=>{
        fetch('http://localhost:5000/tipoDeConta',{
            method:'GET',
            headers:{
                'Content-Type':'application/json'
            }
        }).then(resp=>resp.json()).then(data=>setTiposContas(data))
    },[])

    return (
        <>
           
                <Input type='text' name='nomeProprietario' text='Nome do proprietario' placeholder='ex:JoÃ£o Ernesto' ></Input>
                <Input type='date' name='dataNascimento' text='Data de nascimento'></Input>
                <Select array={tiposContas}></Select>
               

          
        </>
    )
}

export default ContaForms
